fizz_buzz &lt;- function(fbnums = 1:50) {
  output &lt;- dplyr::case_when(
    fbnums %% 15 == 0 ~ "FizzBuzz",
    fbnums %% 3 == 0 ~ "Fizz",
    fbnums %% 5 == 0 ~ "Buzz",
    TRUE ~ as.character(fbnums)
  )
  print(output)
}


def fizz_buzz(num):
   if num % 15 == 0:
      print("FizzBuzz")
   elif num % 5 == 0:
      print("Buzz")
   elif num % 3 == 0:
      print("Fizz")
   else:
      print(num)
